import React from 'react';
// import logo from './logo.svg';
// Import the BrowserRouter, Route and Link components
import { BrowserRouter, Route, Link } from 'react-router-dom'; 
import Projects from './Projects.js'; 
import Articles from './Articles.js'; 
import About from './About.js'; 
import './App.css';
import DentalDeserts from './DentalDeserts';
import NHLAttendance from './NHLAttendance';
import CommuteForecast from './CommuteForecast';

class App extends React.Component {
  render() {
    return (
      <BrowserRouter>
      <div className="Apps">
  
            {/*Set up the router*/}

            {/*<Route exact path="/" component={Projects} />*/}
            <Route path="/CommuteForecast" component={CommuteForecast} />
            <Route path="/DentalDeserts" component={DentalDeserts} />
            <Route path="/NHLAttendance" component={NHLAttendance} />
            <Route path="/articles" component={Articles} />
            <Route path="/about" component={About} />
            <Route path="/Projects" component={Projects} />
            <div className="app-wrapper">
              <aside className="app-sidebar">
                <div className="app-sidebar-container">
                  <div class="app-sidebar-content">
                    {/* Set up the Links*/}
                    <label class="logo">DesignY</label>
                    <ul>
                      <li><Link to="/" className="item">Home</Link></li>
                      <li><Link to="/Projects" className="item">Projects</Link></li>
                      <li><Link to="/articles" className="item">Articles</Link></li>
                      <li><Link to="/about" className="item">About</Link></li>
                    </ul>
                  </div>
                  <div className="app-sidebar-footer"></div>
                </div>
              </aside>
              <main className="app-content"> 
                <div className="homepage-wrapper">
                  <div className="homepage-bg"></div>
                  <div className="homepage-content">
                    <h1 className="homepage-heading">Welcome!</h1>
                    <p className="homepage-intro">This is my portfolio
                    using react! </p> 
                  </div>
                </div>
              </main>
              </div>
        </div>
      </BrowserRouter>
    );
  }

}
export default App;
